import Link from 'react-router-dom'
import styled from 'styled-components'
import { colors, fonts } from '../../utils/style/variables'
import MainCourseIcon from '../../assets/poisson.png'
import Dessert from '../../assets/dessert.png'
import Chef from '../../assets/chef.png'
import Drinks from '../../assets/jus.png'
import Preps from '../../assets/soupe.png'

const StyledMenuWrapper = styled.div`
    display: grid;
    grid-template-columns: repeat(auto-fill, minmax(clamp(60px, 50%, 180px), 1fr));    
    grid-auto-rows: minmax(60px, auto);
    grid-gap: 30px;
    margin: 0 auto;
    width: 50vw;
`
const StyledLink = styled.div`
    display: flex;
    justify-content: center;
    align-items: center;
    background-color: ${colors.tertiary};
    aspect-ratio: 1/1;
    border-radius: 33px;
    padding: 15px;
`
const StyledTitle = styled.h1`
    text-align: center;

    display: flex;
    margin: 0 auto;
    font-family: ${fonts.header};
    color: black;
    font-size: clamp(30px, 90vw, 60px);
    width: 100%;
    word-wrap: break-word;
`

function HomeIcon() {
    return (
        <StyledMenuWrapper>
            <StyledLink>
                <StyledTitle>MAIN</StyledTitle>
            </StyledLink>

            <StyledLink>
                <StyledTitle>SW<br></br>EET</StyledTitle>
            </StyledLink>

            <StyledLink>
                <StyledTitle>BAS<br></br>ICS</StyledTitle>
            </StyledLink>

            <StyledLink>
                <StyledTitle>DRI<br></br>NKS</StyledTitle>
            </StyledLink>
        </StyledMenuWrapper>
    )
}

export default HomeIcon
